import React from "react";
import styles from "sidena"

import { Link } from "react-router-dom";
const Sidenavigation = ({useButtons}) => {
  return (
    <div className={styles.head_wrapper}>
      <div className={styles.head_container}>
        <img src="./images/logo.png" alt="logo" width={50} />
        <div className={`flexCenter ${styles.head_menu}`}>  
          <Link className = {styles.link} to = "/"> Home</Link>
          <Link className = {styles.link} to = "/"> Summarize / Question </Link>
          <Link className = {styles.link} to = "/Note"> Note </Link>
          <Link className = {styles.link} to ='/'> About </Link> 
        </div>
        <div className={styles.daynight_btn}>
        <img src="./images/night-mode.png"/>
        </div>
        </div>
        </div>)}
export default Sidenavigation;
